import React from "react";
import { Navbar, NavbarBrand } from "reactstrap";

export const NavBar = () => {
  return (
    <>
      <Navbar className="my-2" color="dark" dark>
        <NavbarBrand href="/">
          <img
            alt="logo"
            src="/logo-white.svg"
            style={{
              height: 40,
              width: 40,
            }}
          />
        </NavbarBrand>
      </Navbar>
      <Navbar className="my-2" color="secondary" dark>
        <NavbarBrand href="/">Reactstrap</NavbarBrand>
      </Navbar>
      <Navbar className="my-2" color="dark" dark>
        <NavbarBrand href="/">
          <img
            alt="logo"
            src="/logo-white.svg"
            style={{
              height: 40,
              width: 40,
            }}
          />
          Reactstrap
        </NavbarBrand>
      </Navbar>
    </>
  );
};

export default NavBar;
